import React from 'react'
import { 
  Box, 
  Stack, 
  styled,
} from '@mui/material'

import imgMen from '../assets/men.png';




const Information = () => {

    const StackColumn = styled(Stack) (() => ({
      flexDirection: 'row',
      justifyContent: 'flex-',
      alignItems: 'center',
      flex: 1,
      gap: 8,
      textAlign: 'center',
    }));
  
    const BoxRow = styled(Box) (({ theme }) => ({
      display: 'flex',
      flexDirection: 'row',
      height:'300px',
      backgroundColor: '#000544',
      flex: 1,
      [theme.breakpoints.down('sm')]: {
        flexDirection: 'column',
        gap: 30,
      }
    }));
  
    return (
      
      <BoxRow 
      component = 'informaion'
      sx={{
        py: 4,
        px: 2,
      }}
      >
        <StackColumn>
      
        <img src={imgMen} alt="Homem Apontando" class="imagem-direita"/>
       
   
        </StackColumn>
      </BoxRow>
    )
  }

  export default Information
